import React from 'react';
import { BrowserRouter } from "react-router-dom";
import { Provider } from 'react-redux';
import App from './App';

const app = (
    <Provider store={createStoreWithMiddleware(reducers)}>
       <BrowserRouter>
          <App />
       </BrowserRouter>
    </Provider>
 );

export default app;
